import "./Navbar.scss";

const Navbar = () => {
    return(
        <div className="navbar">
            <a href="#aboutus">ABOUT</a>
            <a href="#foryou">FOR YOU</a>
            <a href="#sevices">SERVICES</a>
            <a href="#blog">BLOG</a>
            <a href="#vlog">VLOG</a>
            <a href="#contact">CONTACT</a>
        </div>
    )
}

export default Navbar;
